import React from "react";

import "./Button.css";

interface ButtonProps { 
    styles: string;
    children: React.ReactNode;
    onClick: () => void;
}

const Button: React.FC<ButtonProps> = function ({ styles, onClick }) {
    return (
        <button className={styles} type = {styles = null ||'submit'} onClick={onClick}>
            {/* <span className="material-icons">add</span> */}
        </button>
    );
}

export default Button;
